import React from 'react';
import styles from './UserCard.module.css';
const UserCard = () => {
  const User = {
    userImage:
      'https://st2.depositphotos.com/1064024/10769/i/600/depositphotos_107694484-stock-photo-little-boy.jpg',
    userDescription: 'user name',
    groupMessage: 'write message',
    groupCall: 'call',
  };
  return (
    <div className={styles.main}>
      <img
        className={styles.user_image}
        src="https://st2.depositphotos.com/1064024/10769/i/600/depositphotos_107694484-stock-photo-little-boy.jpg"
        alt="user photo"
      />
      <div className={styles.user_description}>
        <div>User Name</div>
        <div className={styles.group_message}>
          <div>Write Message </div>
          <div className={styles.group_call}> Call </div>
        </div>
      </div>
    </div>
  );
};

export default UserCard;
